headline_description = ['Animal Well’s platforming seemed too difficult initially, but the game cleverly rewards player frustration if they stick with it long enough to complete the first ending.', "A forestry worker is also arrested and charged with arson over the fire - the country's deadliest.", 'Hundreds of people are feared dead and scores trapped after a landslide in Papua New Guinea.', 'The family of George Floyd marked the fourth anniversary of his murder by renewing their call for Congress to pass legislation to reform policing in America that is named in his honor.', 'Parts of northern India are experiencing a brutal heatwave, with temperatures crossing 48C.', None, 'The United States has just won a significant honor – being named the world’s best country for travel and tourism in 2024.', 'Alderney, a quiet British island in the English Channel known for its outstanding natural beauty, was once the site of the only Nazi camps\xa0on British soil – and a hell on Earth for its thousands of inmates.', 'Israeli protesters have tried to block border crossings, or even attacked aid convoys bound for Gaza.', 'EcoFlow’s PowerStream is a microinverter that can maximize the year-round usefulness of the company’s own solar generators for just $200.', 'The air at the Ukrainian military recruitment office where a 30-year-old hairdresser is being interviewed is filled with anxiety. The man has no military experience and is unsure whether any of his skills would be useful. At one point, the recruiter jokingly …', 'Tens of thousands of people have been forced to flee from months of widespread gang violence in Haiti.', 'Judge James Donato has ordered Google to calculate the costs of complying with Epic’s biggest demands by June 24th, ahead of a final hearing in August.', 'A plant picked for its beautiful flowers then wiped out in the UK mainland makes a dramatic return.', 'Oscar-nominated documentarian Morgan Spurlock passed away at 53 from cancer complications, according to his family. He’s well-known for his film “Super Size Me,” but some of his lesser-known works are just as conversation-invoking.', 'The trial of a former minister who killed his wife has gripped millions and ushered in a new law.', 'The company confirmed it is ‘taking swift action’ to remove some of the AI tool’s bizarre responses.', "The sketch artists at Trump's trial have covered decades of high-profile cases. The former president's was unlike all others.", 'Activision and Meta are facing a lawsuit from the families of the victims killed in the Uvalde, Texas school shooting. The lawsuit accuses the companies of promoting weapons to young men.', 'CNN’s Brian Todd reports on Russian President Vladimir Putin arresting many of his top military officials in what the Kremlin says are efforts to stamp out corruption, but some experts think there could be underlying reasons for his purge.']
